export default class Hit {
    constructor(shape, t) {
        this.shape = shape;
        this.t = t;
    }
    ok() {
        return this.t < 1e9;
    }
    min(b) {
        if (this.t <= b.t) {
            return this;
        }
        return b;
    }
    max(b) {
        if (this.t > b.t) {
            return this;
        }
        return b;
    }
}
export const NoHit = new Hit(null, 1e9);
